import React from "react";
import { Row } from "antd";
import { connect } from "react-redux";
import LeftSection from "../../components/leftSection";
import RightSection from "../../components/rightSection";
const Home = () => {
  return (
    <div className="App">
      <div className="header">
        <h4>Trip</h4>
      </div>
      <Row>
        <LeftSection />
        <RightSection />
      </Row>
    </div>
  );
};

export default Home;
